import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import './index.css';


class Botao extends Component {
  render(){
    return (
      <div>
        <Link to = {this.props.link} className = {this.props.className}> { this.props.nome }</Link>
      </div>
    );
  }
}

export default Botao;
